import "./App.css";
import ShoppingCart from "./component/ShoppingCart";
import ToDoList from "./component/ToDoList";
import { BrowserRouter, Routes, Route } from "react-router-dom";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route
            path="/"
            exact
            element={
              <>
                <ToDoList /> <ShoppingCart />
              </>
            }
          />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
